







-- 랜덤 경매 1000건 + 각 경매에 임의 입찰 1건 생성
BEGIN
  FOR i IN 1..1000 LOOP
    -- 각 루프마다 시작가 생성 (예: 10000 ~ 100000 사이 100단위)
    -- 필요에 따라 구간/단위를 조정하세요.
    DECLARE
      v_StartPrice NUMBER := TRUNC(DBMS_RANDOM.VALUE(100, 1000)) * 100; -- 10,000 ~ 100,000
      v_ItemID     ITEM.ItemID%TYPE;
      v_SellerID   USERS.UserID%TYPE;
      v_RegisterInventoryId Auction.RegisterInventoryId%TYPE;
      v_StartTime       TIMESTAMP;
    BEGIN
      -- 랜덤 아이템/판매자 선택
      SELECT inventoryid, ItemID, userid INTO v_RegisterInventoryId, v_ItemID, v_SellerID
      FROM (SELECT * FROM INVENTORY ORDER BY DBMS_RANDOM.VALUE)
      WHERE ROWNUM = 1;

      v_StartTime := SYSTIMESTAMP - NUMTODSINTERVAL(DBMS_RANDOM.VALUE(1, 10), 'DAY');


        AuctionID,
        Start_Price,
        StartTime,
        EndTime,
        CurrentHighestPrice,
        ItemID,
        SellerID,
	RegisterInventoryId
      ) VALUES (
        100 + i,
        v_StartPrice,
        v_StartTime,
        v_StartTime + NUMTODSINTERVAL(7, 'DAY'),
        v_StartPrice,           -- 시작 시 최고가 = 시작가
        v_ItemID,
        v_SellerID,
	v_RegisterInventoryId
      );

      -- 해당 경매에 대한 임의의 입찰 1건
        AuctionID,
        BidderID,
        BidTime,
        BidAmount
      ) VALUES (
        100 + i,
        (SELECT UserID FROM (SELECT UserID FROM USERS ORDER BY DBMS_RANDOM.VALUE) WHERE ROWNUM = 1),
        SYSTIMESTAMP + NUMTODSINTERVAL(i, 'SECOND'),
        TRUNC(DBMS_RANDOM.VALUE(100, 2000)) * 100  -- 10,000 ~ 200,000
      );
    END;
  END LOOP;
  COMMIT;
END;
/

DECLARE
  v_count NUMBER := 0;
BEGIN
  FOR rec IN (
    SELECT UserID, AuctionID
    FROM (
      SELECT u.UserID, a.AuctionID, DBMS_RANDOM.VALUE AS rnd
      FROM USERS u CROSS JOIN AUCTION a
    )
    ORDER BY rnd
    FETCH FIRST 2000 ROWS ONLY
  )
  LOOP
    BEGIN
      VALUES (
        rec.UserID,
        rec.AuctionID,
        SYSTIMESTAMP - NUMTODSINTERVAL(DBMS_RANDOM.VALUE(0, 30), 'DAY')
      );
      v_count := v_count + 1;
    EXCEPTION
      WHEN DUP_VAL_ON_INDEX THEN NULL;
    END;
    EXIT WHEN v_count >= 500;
  END LOOP;
  COMMIT;
END;
/




BEGIN
  FOR i IN 1..500 LOOP
      HistoryID,
      AuctionID,
      FinalPrice,
      TradeTime
    ) VALUES (
      i,                                      -- PK가 시퀀스/IDENTITY면 이 컬럼/값 제거
      100 + i,                                -- AUCTION 101~600 가정
      TRUNC(DBMS_RANDOM.VALUE(1000, 5000)) * 100,  -- 100,000 ~ 500,000
      SYSTIMESTAMP - NUMTODSINTERVAL(DBMS_RANDOM.VALUE(1, 30), 'DAY')
    );
  END LOOP;
  COMMIT;
END;
/


DECLARE
BEGIN
  SELECT
      ROW_NUMBER() OVER (ORDER BY b.AuctionID) AS TradeID,
      b.AuctionID,
      a.SellerID,
      b.BidderID AS BuyerID,
      b.BidTime  AS TradeTime,
      b.BidAmount AS FINAL_PRICE,
      ROUND(b.BidAmount * 0.10) AS COMMISSION
  FROM (
      SELECT AuctionID, MAX(BidTime) AS LastBidTime
      FROM BIDDING_RECORD
      GROUP BY AuctionID
  ) bl
  JOIN BIDDING_RECORD b
    ON bl.AuctionID = b.AuctionID
   AND bl.LastBidTime = b.BidTime
  JOIN AUCTION a
    ON a.AuctionID = b.AuctionID;

  COMMIT;
END;
/

